import React from 'react'
import Container from "react-bootstrap/Container";
import styled from "styled-components";
import Skewleft from './Skewleft';
import Typography from '@mui/material/Typography';
import award from '../assets/images/award.jpg'

const Areacounting = () => {
    const Countingwrapper = styled.section`
        display:flex;
        position:relative;
        .counting_section{
            margin-top:270px;
            .parent{
                div{
                }
                .label{
                    margin-bottom:15px;
                    h3{
                    color:${({theme})=>theme.colors.headeractive};
                    font-family:inherit;
                    margin:0!important;
                    }
                    span{
                        color:${({theme})=>theme.colors.text7};
                        position: relative;
                        font-size:14px;

                    }
                }
                .list_details{
                    display:flex;
                    flex-wrap:wrap;
                    flex-direction:row;
                    .list{
                        flex:0 1 20%;
                        text-align:center;
                        padding:15px;
                        box-shadow: 0 6px 16px rgb(52 105 203 / 16%);
                        margin: 0 25px 25px 0;
                        border-top-right-radius: 10%;
                        border-bottom-left-radius: 10%;
                        .image_container{
                            width:80%;
                            margin:auto;
                            position:relative;
                            img{
                                object-fit:cover;
                            }
                            span{
                                position: absolute;
                                left: 50%;
                                top: 40%;
                                transform: translate(-50%, -40%);
                                color: white;
                            }
                        }
                        span{
                            color:${({theme})=>theme.colors.text7};
                            position: relative;
                            font-size:14px;

                        }
                    }
                }
            }
        }
    
    `;

