                        </div>
                        <span>khattalawada</span>                        
                    </section>
                    <section className='list'>
                        <div className='image_container'>
                            <img src={award} alt="demko"/>
                            <span>98</span>
                        </div>
                        <span>khattalawada</span>                        
                    </section>
